    <>
      <div>
        {name === '리액트' ? (
          <h1>리액트입니다.</h1>
        ) : (
          <h2>리액트가 아닙니다.</h2>
        )}
        <h1>{name} 안녕!</h1>
        <h2>잘 작동하니?</h2>
      </div>
    </>
   );
}

export default App;
